import React from "react";
import './Navbar.css';

const Navbar = () => {
    return (
        <div>
            <div className="navbar">
                <a>Navbar</a>
            </div>

            <div className="menu">
                <ul style="float:right">
                    <li><a href="#home">Home</a></li>
                    <li><a href="#news">News</a></li>
                    <li><a href="#contact">Contact</a></li>
                    <li><a href="#about">About</a></li>
                </ul>
            </div>
        </div>

    )
}

export default Navbar;
